import DayOfWeek from "./mini_components/DayOfWeek";
import { useState } from "react";

const Schedule = () =>
{
    const [schedule, setSchedule] = useState([
        {
            "id": 7,
            "day_of_week": "monday",
            "start_time": "09:00:00",
            "end_time": "09:45:00",
            "class_name": "geography",
            "classroom": 214,
            "schedule": 1
        },
        {
            "id": 8,
            "day_of_week": "monday",
            "start_time": "10:00:00",
            "end_time": "10:45:00",
            "class_name": "math",
            "classroom": 302,
            "schedule": 1
        },
        {
            "id": 9,
            "day_of_week": "monday",
            "start_time": "11:00:00",
            "end_time": "11:45:00",
            "class_name": "PE",
            "classroom": 123,
            "schedule": 1
        }])

    return (
        <div>
            <h1 style={{textAlign: 'center'}}>Расписание</h1>
            <DayOfWeek lessons = {schedule.filter(day => day.day_of_week === "saturday")}/>
        </div>
        
    )
}

export default Schedule;
